import React, { Component } from "react";
import { Navbar } from "react-bootstrap";
import NavBarAdmin from "./navbaradmin";

class AddDriver extends Component {
  render() {
    return (
      <div>
        <NavBarAdmin />
        <div style={style}>
          <h4>Add Driver</h4>
        </div>
      </div>
    );
  }
}

const style = {
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  margin: "30px auto"
};

export default AddDriver;
